import React from 'react';
import PropTypes from 'prop-types'


const Opacity = {
  background: 'none',
  borderBottom: '1px solid white',
}

const Tint = {
  backgroundColor: "backgroundColor:'rgba(0, 0, 0, 0.2)'",
  borderBottom: '1px solid white',
}


const Nav = (props) => {
  let isShow = false;
  const showNavbar = (e) => {
    e.preventDefault();
    const navbarContent = document.getElementById('navbarContent');
    const navbar = document.getElementById('navbar');
    if(!isShow){
      isShow=true;
      navbarContent.classList.remove('collapse');
      navbar.style = Tint;
    }
    else{
      isShow=false;
      navbarContent.classList.add('collapse');
    }
  }
  return(
    <header className="fixed-top container-fluid">
      <div className="row" >
        <nav id="navbar" className="navbar navbar-expand-lg offset-md-1 col-md-10 border-rounded" style={Opacity}>
          <button className="navbar-brand btn btn-link m-0 p-0" style={props.navStyle} onClick={(e)=>props.navMove(e,'home')}><p className='h2 m-0' style={props.navStyle}>Internal Medicine</p></button>
          <button className="navbar-toggler" onClick={e=>showNavbar(e)} style={{color:'white'}}>&#9776;</button>
          <div className="collapse navbar-collapse" id="navbarContent">
            <ul className="navbar-nav ml-auto">
              <li className="nav-item align-self-center">
                <button className="nav-link btn btn-link" onClick={(e)=>props.navMove(e,'home')}><p className="h5 m-0" style={props.navStyle}>Home</p></button>
              </li>
              <li className="nav-item align-self-center">
                <button className="nav-link btn btn-link" onClick={(e)=>props.navMove(e,'contact')}><p className="h5 m-0" style={props.navStyle}>Contact Us</p></button>
              </li>
              <li className="nav-item align-self-center">
                <button className="nav-link btn btn-link" onClick={(e)=>props.navMove(e,'form')}><p className="h5 m-0" style={props.navStyle}>Forms</p></button>
              </li>
            </ul>
          </div>
        </nav>
      </div>
    </header>
  );
}

Nav.propTypes={
  navStyle: PropTypes.object.isRequired,
  navMove: PropTypes.func.isRequired,
}

export default Nav;
